import { BrowserRouter as Switch, Router, Routes, Route } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import { Dashboard } from './views/Dashboard';
import { Header } from './views/Header';
import axios, { AxiosResponse } from 'axios';
import { useState, useEffect } from 'react';
import React from 'react';
import { Login } from './views/Login';
import { getCurrentUser } from './resources';
import { CompanyForm } from './views/CompanyForm';

function App() {
    return (
        <>
            <Router location={'/'} navigator={'go'}>
                <div className="container">
                    <Header />
                    <Routes>
                        <Switch>
                            <Route path="/" element={<Dashboard />} />
                            <Route path="/addCompany" element={<CompanyForm />} />
                        </Switch>
                    </Routes>
                </div>
            </Router>
            <ToastContainer />
        </>
    );
}

export default App;
